
CREATE TABLE Canciones (

                         id INT AUTO_INCREMENT PRIMARY KEY,
                         titulo VARCHAR(100) NOT NULL,
                         artista VARCHAR(255), -- Cambiado a VARCHAR para almacenar el nombre del artista
                         estilo VARCHAR(255),  -- Cambiado a VARCHAR para almacenar el nombre del estilo
                         imagen LONGTEXT,
                         album VARCHAR(255),
                         duracion VARCHAR(80),


);


spring.jpa.hibernate.ddl-auto=none
spring.jpa.defer-datasource-initialization=true
spring.sql.init.mode=always
